import styled from 'styled-components';


export const StyledDiv = styled.div`
  background-color: gray;
  border: 1px solid black;
  padding: 4px 10px;
  color: white;
  height:300px;
  width:300px
`

export const Image = styled.image`
height:50px;
width:250px;
`
